#Find coordinates of elements in S matrix
def find_coordinates(S_in, M_in):
    S_index=0
    I_S=[]
    J_S=[]

    for i_s in S_in:
        tmp=find_index(M_in, i_s)
        I_S.append(tmp[0])
        J_S.append(tmp[1])
        S_index+=1
    return I_S, J_S

